import React from "react";
import { NavLink } from 'react-router-dom';
import './Sb.css';


const Sb = () => {
    return (
        <container>
            <div>
                <NavLink to="/" className="Login">Sign Up</NavLink>
                <NavLink to="./sign" className="sign">Login </NavLink>
            </div>


        </container>


    );
}

export default Sb;
